import React from 'react';
import { Menu, Layout, Image } from 'antd';
import { useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import logo from '../../img/logoshop.png';
import PersonOutlineIcon from '@material-ui/icons/PersonOutline';
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';
import SearchIcon from '@material-ui/icons/Search';
const { Header } = Layout;
const HeaderShopping = () => {
  const numberCart = useSelector(
    state => state.reducerCart.shoppingCart
  ).length;
  return (
    <Header className="container_header">
      <div className="container_header_logo">
        <Image src={logo} alt="No" width={150} height={100} preview={false} />

        <div className="menu_icon">
          <ul>
            <li>
              <a href="/">HOME</a>
            </li>
            <li>
              <a href="/">PAGES</a>
            </li>
          </ul>
          <div className="icon">
            <div className="icon_item">
              <PersonOutlineIcon />
            </div>
            <div className="icon_item">
              <ShoppingCartIcon />
            </div>
            <div className="icon_item">
              <SearchIcon />
            </div>
            {/* <PersonOutlineIcon />
            <ShoppingCartIcon /> */}
          </div>
        </div>
      </div>

      {/* <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
        <Menu.Item key="/">
          <Link to="/"> Products</Link>
        </Menu.Item>
        <Menu.Item key="cart">
          <Link to="/cart">cart ({numberCart})</Link>
        </Menu.Item>
        <Menu.Item key="login">
          <Link to="/login">Login</Link>
        </Menu.Item>
      </Menu> */}
    </Header>
  );
};
export default React.memo(HeaderShopping);
